import React from 'react'

const url = "https://www.google.com/search?q=Jubin+Nautiyal&oq=ju&aqs=chrome.0.69i59j69i57j0i67l2j46i199i433i465i512j46i67i199i465j46i20i263i433i512j0i20i263i433i512j46i199i433i465i512j46i433i512.2666j0j15&sourceid=chrome&ie=UTF-8";

function Album() {
    return (
        <div className='main'>
            <img src="https://a10.gaanacdn.com/gn_img/albums/10q3Zj1352/q3ZR6q4035/size_l_1629048201.webp"></img>
            <h1>Shershaah</h1>
            <a href={url}>Jubin Nautiyal</a>

        </div>
    )
}

export default Album;
